import React from 'react';
import TeamData from '../../static/team-page-info'; 
import Avatar from '@material-ui/core/Avatar'; 
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import InstagramIcon from '@material-ui/icons/Instagram';
import FacebookIcon from '@material-ui/icons/Facebook';
import LinkedInIcon from '@material-ui/icons/LinkedIn';
import IconButton from '@material-ui/core/IconButton'
import './TeamPage.css';



export default function TeamPage() {
  return (
    <div >
      <h1 style={{margin: "30px"}}>Our Team</h1>
      <Grid container spacing={0} 
      alignItems="center"
      justify="center">          
        {TeamData.teamData.map((member) => (
          <Grid item xs={12} sm={4} className="person" style={{marginBottom: "50px"}}>
            <Avatar src={member.image} className="avatar" style={{width: "150px", height: "150px"}}></Avatar>
            <p style={{marginLeft: "10%", marginRight: "10%", textAlign: "left"}}>
            <span style={{fontWeight: "bold"}}>{member.name}</span>
            <br></br><br></br>
            {member.bio}</p>
            <IconButton color="secondary" aria-label="upload picture" component="span" onClick="window.open({member.instagram})">
              <InstagramIcon/>
            </IconButton>
            <IconButton color="primary" aria-label="upload picture" component="span">
              <FacebookIcon/>
            </IconButton>
            <IconButton color="primary" aria-label="upload picture" component="span">
              <LinkedInIcon/>
            </IconButton>
          </Grid>
        ))}
      </Grid>
    </div>

  );
}
